import { JeecgListMixin } from '@/mixins/JeecgListMixin';
import StkInventoryModal from './modules/StkInventoryModal';
import JDictSelectTag from '@/components/dict/JDictSelectTag.vue';
import JSearchSelectTag from '@/components/dict/JSearchSelectTag';
import ListColumnsSetter from '../components/ListColumnsSetter';
export default {
  name: "StkInventoryList",
  mixins: [JeecgListMixin],
  components: {
    JDictSelectTag: JDictSelectTag,
    JSearchSelectTag: JSearchSelectTag,
    ListColumnsSetter: ListColumnsSetter,
    StkInventoryModal: StkInventoryModal
  },
  data: function data() {
    return {
      description: '实时库存',
      // 表头
      columns: [{
        title: '#',
        dataIndex: '',
        key: 'rowIndex',
        fixed: 'left',
        width: 40,
        align: "center",
        customRender: function customRender(t, r, index) {
          return parseInt(index) + 1;
        }
      }, {
        title: '批号',
        width: 200,
        fixed: 'left',
        align: "center",
        dataIndex: 'batchNo',
        scopedSlots: {
          customRender: 'batchNo'
        }
      }, {
        title: '仓库',
        width: 150,
        align: "left",
        dataIndex: 'warehouseId_dictText'
      }, {
        title: '物料',
        align: "left",
        dataIndex: 'materialId_dictText'
      }, {
        title: '计量单位',
        width: 80,
        align: "center",
        dataIndex: 'unitId_dictText'
      }, {
        title: '数量',
        width: 120,
        align: "center",
        dataIndex: 'qty'
      }, {
        title: '成本',
        width: 120,
        align: "center",
        dataIndex: 'cost'
      }, {
        title: '单供应商',
        width: 80,
        align: "center",
        dataIndex: 'isSingleSupplier_dictText'
      }, {
        title: '供应商',
        align: "center",
        dataIndex: 'supplierId_dictText'
      }, {
        title: '是否关闭',
        width: 80,
        align: "center",
        dataIndex: 'isClosed_dictText'
