        title: '创建时间',
        width: 100,
        align: "center",
        dataIndex: 'createTime',
        customRender: function customRender(text) {
          return !text ? "" : text.length > 10 ? text.substr(0, 10) : text;
        }
      }, {
        title: '创建部门',
        width: 120,
        align: "center",
        dataIndex: 'sysOrgCode_dictText'
