        title: '创建人',
        width: 100,
        align: "center",
        dataIndex: 'createBy_dictText'
      }, {
        title: '修改时间',
        width: 100,
        align: "center",
        dataIndex: 'updateTime',
        customRender: function customRender(text) {
          return !text ? "" : text.length > 10 ? text.substr(0, 10) : text;
        }
      }, {
        title: '修改人',
        width: 100,
        align: "center",
        dataIndex: 'updateBy_dictText'
      }, {
        title: '操作',
        dataIndex: 'action',
        fixed: 'right',
        width: 120,
        align: "center",
        scopedSlots: {
          customRender: 'action'
        }
      }],
      url: {
        list: "/stock/stkInventory/list",
        delete: "/stock/stkInventory/delete",
        deleteBatch: "/stock/stkInventory/deleteBatch",
        exportXlsUrl: "/stock/stkInventory/exportXls",
        importExcelUrl: "stock/stkInventory/importExcel"
      },
      dictOptions: {}
    };
  },
  computed: {
    importExcelUrl: function importExcelUrl() {
      return "".concat(window._CONFIG['domianURL'], "/").concat(this.url.importExcelUrl);
    }
  },
  methods: {
    initDictConfig: function initDictConfig() {},
    myHandleAdd: function myHandleAdd() {
      this.$refs.modalForm.action = "add";
      this.handleAdd();
    },
    myHandleEdit: function myHandleEdit(record) {
      this.$refs.modalForm.action = "edit";
      this.handleEdit(record);
    },
    myHandleDetail: function myHandleDetail(record) {
      this.$refs.modalForm.action = "detail";
      this.handleDetail(record);
    }
  }
};
